    long long maximumValueSum(vector<vector<int>>& v) {
        int n=v.size();
        int m=v[0].size();
        vector<vector<long long>>a;
        for(int i=0;i<n;i++){
            for(int j=0;j<m;j++){
                a.push_back({v[i][j],i,j});
            }
        }
        long long ans=-1e17;
        sort(a.begin(),a.end());
        reverse(a.begin(),a.end());
        int hhh=a.size();
        for(int i=0;i<min(hhh,400);i++){
            int pp=a[i][1];
            int qq=a[i][2];
            for(int j=i+1;j<min(hhh,400);j++){
                    int rr=a[j][1];
                    int ss=a[j][2];
                    if(pp==rr) continue;
                    if(qq==ss) continue;
                for(int k=j+1;k<min(hhh,400);k++){
                    int tt=a[k][1];
                    int uu=a[k][2];
                    if(pp==rr || rr== tt || pp==tt) continue;
                    if(qq==ss || ss== uu || qq==uu) continue;
                    long long vv=a[i][0]+a[j][0]+a[k][0];
                    ans=max(ans,vv);
                }
            }
        }
        return ans;
    }
};
